import React, {Component} from 'react'
import './App.css';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import ReactDOM from 'react-dom'
//import WidthDisplay from './components/utils/widthdisplay'


// Pages
import Home from './pages/home'
import Login from './pages/login'
import Registrierung from './pages/registrierung'
import Menu from './components/menu'
import Scene from './pages/menudrop'


class App extends Component {

  render() {
    return (
      <React.Fragment>
        <div style={{background:"white"}}>
          <Router>
            <Menu /> 
            <div className="container">
              <Switch>
                <Route exact path="/" component={Home} />
                <Route exact path="/menuDrop" component={Scene} />
                <Route exact path="/registrierung" component={Registrierung} />
                <Route exact path="/login" component={Login} />
              </Switch>
            </div>
          </Router>
        </div>
      </React.Fragment>
    )
  }
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);

export default App;
